export const imgToBase64 = (file: any) => {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();

    reader.onloadend = () => {
      resolve(reader.result);
    };

    reader.onerror = (error) => {
      reject(error);
    };

    reader.readAsDataURL(file);
  });
};

export const defaultCoverImage = `data:image/jpeg;base64,`;

export const defaultLogoImage = `
data:image/jpeg;base64,
`;

export const profissionalPhoto = `data:image/png;base64,`;

export const serviceImage = `data:image/png;base64,`;
